import { GoogleLogin, GoogleLogout } from 'react-google-login';

const Header = (props) => {

    function loggedIn() {
        props.loggoSetter(true);
        console.log('logged in');
    }

    function loggedOut() {
        props.loggoSetter(false);
    }

    if(props.loggo){
        return (
            <div className="m-10 flex place-content-between">
                <div className="flex font-bold text-4xl text-[#F4D47E]">
                    SPEED TYPER V2
                </div>
                <div className="flex bg-[#F4D47E] rounded-xl px-4 text-center">
                    <div className="flex flex-col justify-center">
                        <GoogleLogout 
                            clientId='615805703985-8sj5reb1j7sc7vdi648huunoqesvrsla.apps.googleusercontent.com'
                            onLogoutSuccess={loggedOut}
                            onFailure={console.log('Could not log out')}
                        />
                    </div>
                </div>
            </div>
            )
    }
    return (
    <div className="m-10 flex place-content-between">
        <div className="flex font-bold text-4xl text-[#F4D47E]">
            SPEED TYPER V2
        </div>
        <div className="flex bg-[#F4D47E] rounded-xl px-4 text-center">
            <div className="flex flex-col justify-center">
                <GoogleLogin 
                    clientId='615805703985-8sj5reb1j7sc7vdi648huunoqesvrsla.apps.googleusercontent.com'
                    onSuccess={loggedIn}
                    onFailure={console.log('Could not log in')}
                />
            </div>
        </div>
    </div>
    )
}    

export default Header;
